INSERT INTO `notes` VALUES (39,15,'<p>Ap&oacute;s reset no equipamento ATM0 down.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(40,15,'<p>Aberto chamado junto a operadora.&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(41,15,'<p>realizado configura&ccedil;&atilde;o de rota na esta&ccedil;&atilde;o da OI.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(42,16,'<p>Em contato com Jacqueline da loja, a mesma informou que a regi&atilde;o esta sem energia, devido problema el&eacute;trico no poste.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(43,16,'<p style=\"text-align: left;\">Energia da loja restabelecida.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(44,17,'<p>Realizado teste com gerente o modem esta sem o sinal 104.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(45,17,'<p>Conforme informa&ccedil;&otilde;es da operadora, o t&eacute;cnico Erison em deslocamento, com previs&atilde;o de chegada as 12:45.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(46,17,'<p>Realizado a troca do modem.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(47,18,'<p>Em contato com o gerente, o mesmo informou falta de energia no bairro.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(48,19,'<p>&nbsp;84 input errors, 37 CRC, 2 frame, 4 overrun, 0 ignored, 41 abort</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(49,19,'<p>Realizado gerenncia de configura&ccedil;ao com o suprte</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(50,20,'<p>link down</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(51,20,'<p>Loja online mas chamado ainda aberto na operadora,sem inform&ccedil;&atilde;o da tratativa.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(52,20,'<p>Modem do cliente danificado, foi&nbsp;substituido.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(53,21,'<p>Protocolo:&nbsp;15109070&nbsp;</p>\r\n<p>Chamado registrado.</p>\r\n<p>&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(54,21,'<p>Atendente da oi pediu para confirmar um atendimento para o dia 25/07 mas foi recusado. Atendente orientado a fazer o atendimento ainda hoje.&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(55,21,'<p>T&eacute;cnico da oi entrou em contato para pedir novamente a o reagendamento da visita t&eacute;cnica no local explicando que o acesso ao DG interno n&atilde;o &eacute; poss&iacute;vel no fim de semana e em contato com o gerente regional <strong>Bruno Ara&uacute;jo</strong> ele confirmou que a loja n&atilde;o abre no domingo. Mediante isso, foi autorizado por <strong>Fernando Carvalho</strong> o reagendamento para segunda-feira dia 25/07.<strong> Loja est&aacute; funcionando pelo XDSL.</strong></p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(56,21,'<p>gerente Sandro <strong>mat 165374</strong>&nbsp;informou que acionou um tecnico em eletrica devido a OI informar problema de eletrica na filial,ficando o reparo agendado para dia 26/07/2016.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(57,21,'<p>Feito reparo no cabeamento do DG ao Rack. Link reestabelecido.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(58,22,'<p>Processo de abertura de reparo em andamento.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(59,22,'<p>Reparo de ropimento de fibra.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(60,23,'<p>Chamado registrado!</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(61,23,'<p>Imputando erros CRC na interface serial0/1/0.</p>\r\n<p>Chamado registrado.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(62,23,'<p>Problema de CRC continua. T&eacute;cnico da oi alega problemas na parte de Infra-Estrutura da Loja. Loja est&aacute; sem nobreak. e os queipamentos est&atilde;o ligados por um T.&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(63,23,'<p>chamado encerrado. operadora informa que a causa do problema era o cabo primario com baixa isola&ccedil;&atilde;o. feito manobra do cabo, problema sanado</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(64,24,'<p>Chamado registrado.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(65,24,'<p>O circuito est&aacute; sendo verificado remotamente pelo t&eacute;cnico fabio rocha.&nbsp;</p>\r\n<p>&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(66,24,'<p>Confirmada visita t&eacute;cnica na segunda- feira as 9:00 devido a n&atilde;o conseguir contato com o gerente da loja e o regional.&nbsp;</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(67,24,'<p>Conforme contado com a operadora, o t&eacute;cnico Pires, esta em deslocamento, com previs&atilde;o de chagada ao local as 09:30.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(68,24,'<p>Normalizou.</p>\r\n<p>Recuperou rede de SDH.</p>','2019-10-25 00:06:58','2019-10-25 00:06:58'),(69,25,'<p>Chamado registrado na oi devido a interface serial0/0/0 estar incrementando erros CRC.</p>\r\n<p>&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(70,25,'<p>Multilink n&atilde;o foi desativada devido a perda estar baixa, logo, n&atilde;o impacta no sistema frente-loja (PDV).</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(71,25,'<p>chamado encerrado pela operadora, motivo cabo primario em curto, realizado manobra do cabo primario.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(72,26,'<p>Chamado Aberto com a operadora&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(73,26,'<p>Agendado visita t&eacute;cnica para segunda- feira. Tentei entrar em contato com o gerente da loja mas sem sucesso. Liguei para o gerente regional, mas sem sucesso tamb&eacute;m. Em vista disso foi autorizado pelo Fernando Carvalho a visita para segunda dia 25/07.&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(74,26,'<p>T&eacute;cnico da oi entrou em contato para verificar se o link foi normalizado em raz&atilde;o do t&eacute;cnico ter feito a manuten&ccedil;&atilde;o na parte externa do link. Mas o link n&atilde;o foi normalizado e n&atilde;o foi confirmado a normaliza&ccedil;&atilde;o.&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(75,26,'<p>Link normalizou.</p>\r\n<p>Recupera&ccedil;&atilde;o da estrutura externa da Oi.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(76,27,'<p>Em contato com o gerente da loja, o mesmo informou falta de energia na cidades, e esta sem previs&atilde;o.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(77,28,'<p>Aberto chamado junto a operadora, devido perda de pacote.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(78,28,'<p>encerrado sem interven&ccedil;&atilde;o tecnica.&nbsp;</p>\r\n<p>Normalizado sem atua&ccedil;&atilde;o,</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(79,28,'<p>Circuito cancelado 14/07/2016.</p>\r\n<p>Desinstalado no dia 17/07/2016.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(80,29,'<p>Entrei em contato com o gerente e o mesmo informou que o t&eacute;cnico da oi foi na loja e informou que se trata de rompimento de fibra.&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(81,30,'<p>loja com link dawn numero do chamado &nbsp;15118458 promessa 21:31</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(82,31,'<p>Realizado teste no equioamento, o mesmo esta Down.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(83,31,'<p>Operador da OI entrou em contato para verificar se o link normalizou. Link ainda n&atilde;o foi normalizado.&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(84,31,'<p>O motivo do problema foi fibra rompida por conta obra de terceiros, o servi&ccedil;o executado foi refeita a fus&atilde;o e criada uma emenda. No momento equipe atuando.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(85,31,'<p>Conforme informa&ccedil;&otilde;es da operadora, o circuito esta sendo testado na transmiss&atilde;o.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(86,31,'<p>J&aacute; foi enviado e-mail para Reginaldo Francisco, solicitando prioridade no atendimento do circuito.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(87,32,'<p>Feito testes no equipamentos por&eacute;m, sem sucesso.</p>\r\n<p>Reiniciado Cisco 1800</p>\r\n<p>Nome: Gilson&nbsp;</p>\r\n<p>Mat: &nbsp;174624</p>\r\n<p>&nbsp;</p>\r\n<p>Multilink1 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 100.126.198.90 &nbsp;YES NVRAM &nbsp;down &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;down</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(88,32,'<p>encerrado pela operadora, motivo cabo de fibra optca rompida.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(89,33,'<p>15122160&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(90,33,'<p style=\"text-align: left;\">Realizado teste com a loja</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(91,33,'<p>Troca da fonte na esta&ccedil;&atilde;o da OI.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(92,34,'<p>tentei entrar em contato com a loja mas sem sucesso. dmvpn down no router da loja.&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(93,34,'<p>Atendente da oi entrou em contato e pediu para remarcar a visita do t&eacute;cnico para o dia 28/07 por que o t&eacute;cnico estava atuando em outro lugar e n&atilde;o vai chegar a tempo na loja. Tentei entrar em contato com o gerente da loja e o regional mas sem sucesso. Ent&atilde;o, foi autorizado pelo Fernando carvalho o adiamento da visita para amanh&atilde; (28/07).&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(94,34,'<p>Sem atendimento da OI.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(95,35,'<p>Operador da Oi Israel lima entrou em contato e informou que link mpls est&aacute; fora por conta de um evento de vulso. Problema com a propria operadora.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(96,35,'<p>Normalizou sem atendimento da OI.</p>\r\n<p>&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(97,36,'<h2 style=\"margin: 0.5em 0px; font-family: Arial, Helvetica, sans-serif; padding: 0.4em 1em; font-size: 2em; color: #ffffff; text-shadow: #000000 0px 0px 2px; border-radius: 0.3em; background: #669999;\">Feriados municipais - Gandu-BA com datas comemorativas e pontos facultativos</h2>\r\n<ul style=\"margin: 0px 0px 0px -2em; font-family: Arial, Helvetica, sans-serif; width: 531.656px; list-style-type: none; padding: 0.2px; font-size: 10px;\">\r\n<li style=\"margin: 0.3em 0px 0px 1em; font-size: 1.8em; color: #333333;\"></li>\r\n<li style=\"margin: 0.3em 0px 0px 1em; font-size: 1.8em; color: #333333;\">28/07/2016 ( quinta-feira ) - (&nbsp;<strong style=\"margin: 0px;\">Feriado municipal</strong>&nbsp;)</li>\r\n<li style=\"margin: 0.3em 0px 0px 1em; font-size: 1.8em; color: #333333;\"></li>\r\n</ul>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(98,36,'<p>Contato da loja n&atilde;o atende.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(99,37,'<p>Chamado aberto pelo proativo.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(100,37,'<p>Informa&ccedil;&atilde;o atualizada: &agrave;s&nbsp;16:11 - Tecnico Pedro Paulo verificando circuito no cliente.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(101,37,'<p>Chamado encerrado pela operadora. Motivo: Nilton Simoes informou que o circuito estava ok e que havia aberto uma preventiva para monitorar o link</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(102,38,'<p>Contato com a loja sem sucesso.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(103,38,'<p>Em contato com a operadora, o t&eacute;cnico j&aacute; esta atuando na loja.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(104,38,'<p>Reconfigura&ccedil;&atilde;o do Modem.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(105,39,'<p>Problema no BGP.&nbsp;</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(106,39,'<p>T&eacute;cnico da OI Ubirajara, efetuou testes junto &nbsp;com a ger&ecirc;ncia e informou que o circuito est&aacute; ok .</p>\r\n<p>Em contato com o mesmo, foi trocado o cabo e o modem por&eacute;m, sem &ecirc;xito.</p>\r\n<p>Led 104: Ativo (Operadora)</p>\r\n<p>Led 103: Inativo (Lan)</p>\r\n<p>O chamado permanecer&aacute; aberto.</p>\r\n<p>Solicitado verifica&ccedil;&atilde;o do t&eacute;cnico regional no equipamento.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(107,39,'<p>Oi agendou visita no local 01/08/2016 09:00hs.</p>\r\n<p>Serial0/3/0 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;100.127.153.86 &nbsp;YES manual up &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;down</p>\r\n<p>Serial0/3/1 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;unassigned &nbsp; &nbsp; &nbsp;YES unset &nbsp;down &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;down</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(108,39,'<p>Problema na rede interna do cliente.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(109,40,'<p>Chamado aberto por Irwing &agrave;s 15:25h.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(110,40,'<p>Aguardando verifica&ccedil;&atilde;o do novo roteador pelo t&eacute;cnico regional.</p>\r\n<p>Anselmo ciente.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(111,40,'<p>Chamado cancelado. Reparo aberto indevidamente, informado pelo posto de dados.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(112,41,'<p>15125430 &nbsp;13:39 Aberto chamado junto a operadora.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(113,42,'<p>tecnico da oi esteve em loja omtem 28/07 &nbsp;feito troca de cabo o link normalizou e voltou a cair.</p>\r\n<p>Gerente Tiago David mat 5027.</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(114,42,'<p>chamado encerrado pela operadora, motivo abertura de atividade ativitec</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(115,43,'<p>loja off</p>','2019-10-25 00:06:59','2019-10-25 00:06:59'),(116,43,'<p>Segundo t&eacute;cnico da OI, o link est&aacute; funcionando normalmente at&eacute; o modem.</p>\r\n<p>O mesmo suspeita de falha no roteador.</p>\r\n<p>T&eacute;cnico da regional(Carlos) foi enviado at&eacute; o local para verifica&ccedil;&atilde;o.</p>\r\n<p>Loja fecha &agrave;s 18:00.</p>','2019-10-25 00:06:59','2019-